import React, { lazy } from "react";
import {
  CButton,
  CCard,
  CCardBody,
  CCol,
  CRow,
  CDropdown,
  CDropdownMenu,
  CDropdownItem,
  CDropdownToggle,
  CWidgetDropdown,
} from "@coreui/react";


import DbForm1 from "src/views/forms/DbChart1";


const DataReview = () => {
  return (
    <>
      {/* This section is where all of the widgets go (i.e. line health, alarms, power consumption) */}
      <CRow>
      <CCol sm="6" lg="3">
        <CCard>
          <CCardBody>
            <CRow>
              <CCol>
                <h4 id="traffic" className="card-title mb-0">
                  LED Switch
                </h4>
              </CCol>

              <CCol>
                <LEDSwitch />
              </CCol>
            </CRow>
          </CCardBody>
        </CCard>
      </CCol>

      <CCol></CCol>
    </CRow>
    </>
  );
};

export default DataReview;
